import React from "react";
import {Tile} from "../tile/Tile"

export const TileList = ({appointments}) => {
  // const {data} = props;
  if (!data || !Array.isArray(appointments)) {
    console.log(data)
    // console.log('not an array')
    return null; // or any other fallback behavior, like rendering an error message
  }
  return (
    <div>
     { data.map(({name, ...rest}, index)=>(
      <Tile 
        name={name} 
        key={index} 
        description={rest}
      />
      ))}
      
    </div>
  );
};
